    tweetData: TweetData[];
}

interface TweetPostProps {
    userData: UserData;
}

const Feed: React.FC<FeedProps> = ({headerData, tweetThreads, userData}) => {
    return(
        <div className="feed">
            <Header headerData={headerData}/>
            <TweetPost userData={userData}/>
        </div>
    )
}

